import React from 'react';
import Sidebar from 'C:/Users/namkyun/Desktop/workspace/today/src/components/Sidebar.jsx';

function MyPage() {
  return (
    <div>
      <Sidebar />
      <h1>마이페이지</h1>
      <p>환영합니다! 이곳에서 회원 정보를 확인하고 수정할 수 있습니다.</p>
      {/* 추가적인 마이페이지 내용을 원하는 대로 추가하세요 */}
    </div>
  );
};

export default MyPage;
